    document.getElementById("searchForm").addEventListener("submit", function(e) {

      const output = document.getElementById("results");

      if (result) {
        output.innerHTML = `
          <div style="border:1px solid #ddd; background:#fff; padding:20px; width:400px; margin:20px auto; box-shadow:0 0 10px rgba(0,0,0,0.1); border-radius:8px;">
            <h2 style="color:#333; font-size:20px; margin-bottom:10px;">${query}</h2>
            <div style="background:#e8f1ff; border-left:5px solid #4d6eff; padding:10px; margin-bottom:15px;">
              <strong>Código Dimomaint:</strong><br>
              <span style="font-size:18px; font-weight:bold;">${result["dimomaint"]}</span>
            </div>
            <p><strong>Máquina:</strong> ${result["maquina"]}</p>
            <p><strong>Linha:</strong> ${result["linha"]}</p>
            <p><strong>Descrição:</strong> ${result["desc"]}</p>
            <p><strong>Nº de peça:</strong> ${result["no"]}</p>
          </div>
        `;
      } else {
        output.innerHTML = "<p style='color:red;'>Código não encontrado.</p>";
      }
    });
  </script>
</body>
</html>
